import React, { ReactNode } from "react";
import { BtnEditDeleteBack } from "../../services/BtnEditDeleteBack";
import { Button } from "primereact/button";
import { ConfirmDialog } from "primereact/confirmdialog";
import { Person } from "../interfaces/Person";

interface ButtonNeuesMitgliedProps {
  onNeuesMitglied: () => void;
  btnNeuesMitglied: boolean;
  visible: boolean;
  setVisible: React.Dispatch<React.SetStateAction<boolean>>;
  selectedMitglied: Mitglied | null;
  accept: () => void;
  reject: () => void;
  onÄndernVerein: () => void;
  btnÄndernMitglied: boolean;
  btnLöschenMitglied: boolean;
  onStartMenue: () => void;
}

export function buttonNeuesMitglied({
  onNeuesMitglied,
  btnNeuesMitglied,
  visible,
  setVisible,
  selectedMitglied,
  accept,
  reject,
  onÄndernMitglied,
  btnÄndernMitglied,
  btnLöschenMitglied,
  onStartMenue,
}: ButtonNeuesMitgliedProps): ReactNode {
  return (
    <div>
      <Button
        label="Neues Mitglied"
        className="p-button-outlined m-2"
        onClick={onNeuesMitglied}
        disabled={btnNeuesMitglied}
      />
      <ConfirmDialog
        visible={visible}
        onHide={() => setVisible(false)}
        message={
          selectedMitglied
            ? "Soll der " + selectedMitglied.name + " gelöscht werden?"
            : ""
        }
        header={
          selectedVerein ? "Löschen des " + selectedVerein.name + "?" : ""
        }
        icon="pi pi-exclamation-triangle"
        accept={accept}
        reject={reject}
      />
      <BtnEditDeleteBack
        onÄndern={onÄndernVerein}
        btnÄndern={btnÄndernVerein}
        setVisible={setVisible}
        btnLöschen={btnLöschenVerein}
        onStartMenue={onStartMenue}
      />
    </div>
  );
}
